INSERT INTO `i_item` VALUES (1689938571973160961, '10213', '贵州茅台酒（癸卯兔年）', '玉兔呈祥，瑞盈福臻。2023年癸卯至，贵州茅台推出癸卯兔年贵州茅台酒，集茅台文化，五行文化，生肖文化，书画艺术之大成，鉴藏皆宜。', 'https://resource.moutai519.com.cn/mt-resource/static-union/1672930731ed1499.png', '2023-08-11 17:55:28');
INSERT INTO `i_item` VALUES (1689938572061241345, '10056', '茅台1935', '茅台酱香，股份出品。它延续了茅台产品特有的隽永含蓄的风格特征，突出表现了典雅细腻的闻香，醇厚细致的口感，色香味格有机统一、综合平衡。', 'https://resource.moutai519.com.cn/mt-resource/static-union/16480465902c030c.png', '2023-08-11 17:55:28');
INSERT INTO `i_item` VALUES (1689938572119961601, '2478', '贵州茅台酒（珍品）', '珍酿之品，百福具臻。沿袭初心至真、酒品至珍、风格至臻的理念，汇聚大师匠心，香气完美融合，酒体平衡协调。', 'https://resource.moutai519.com.cn/mt-resource/static-union/16480897792e8039.png', '2023-08-11 17:55:28');
INSERT INTO `i_item` VALUES (1689938572149321730, '10214', '贵州茅台酒（癸卯兔年）', '玉兔呈祥，瑞盈福臻。2023年癸卯至，贵州茅台推出癸卯兔年贵州茅台酒，集茅台文化，五行文化，生肖文化，书画艺术之大成，鉴藏皆宜。', 'https://resource.moutai519.com.cn/mt-resource/static-union/1672930761bf643f.png', '2023-08-11 17:55:28');
